  /**

  Function: _updateUIandDBWithData

  Role:
        Inserts all Diagnose Item Details and Categories Details in DB
        This is called from Diagnose Tab
  **/

  function _updateUIandDBWithData(clientId, diagnoseId, diagnoseName, _newDiagnose, SelectedControls, sharedClassificationData) {
    var diagnoseItemDetailsArray = [];

    //console.log(SelectedControls);

    $.each(SelectedControls, function (key, selectedControlDetails) {

      diagnoseItemDetailsArray.push({
        "toInsert"        : [
                              diagnoseId,
                              key,
                              selectedControlDetails.label,
                              selectedControlDetails.type,
                              selectedControlDetails.valueLabel,
                              selectedControlDetails.value],
        "diagnoseDetail"  : {
                              "controlId": selectedControlDetails.controlId,
                              "diagnoseId":diagnoseId,
                              "controlLabel": selectedControlDetails.label,
                              "controlValueLabel" : selectedControlDetails.valueLabel,
                              "controlValue": selectedControlDetails.value,
                              "categorieschildren": selectedControlDetails.categoriesInfo
                            }
     });
    });

    var queryParametersArray = _.pluck(diagnoseItemDetailsArray, 'toInsert');

    var dbDeferred = $.Deferred();

    var executeOptions = {};
    executeOptions.tableReference = "diagnoseData";
    executeOptions.queryReference = "insertData";
    executeOptions.queryParametersArray = queryParametersArray;
    executeOptions.deferred = dbDeferred;
    executeOptions.queryType = "insert";
    DataModule.executeAll(executeOptions);

    dbDeferred.promise().then(function(resultDiagnoseItemIdArray) {
      _insertCategorizationInfo(diagnoseItemDetailsArray, resultDiagnoseItemIdArray, clientId, diagnoseId,
                                      diagnoseName, _newDiagnose, sharedClassificationData);
    });
  }

  function _insertCategorizationInfo(diagnoseItemDetailsArray, resultDiagnoseItemIdArray, clientId, diagnoseId,
                                      diagnoseName, _newDiagnose, sharedClassificationData) {
    var allDiagnoseDetails = [];

    var diagnoseClassificationQueryParams = [];
    $.each(diagnoseItemDetailsArray, function (i, diagnoseItemDetails) {
      diagnoseItemDetails.diagnoseDetail.diagnoseItemId = resultDiagnoseItemIdArray[i]
      allDiagnoseDetails.push(diagnoseItemDetails.diagnoseDetail);

      var categorizationMap = {};

      $.each(diagnoseItemDetails.diagnoseDetail.categorieschildren, function (k, categoryDetails) {
        if (categoryDetails.data.value) {
          categorizationMap[categoryDetails.data.name] = [];
          categorizationMap[categoryDetails.data.name].push(categoryDetails.data.name);
          diagnoseClassificationQueryParams.push([diagnoseItemDetails.diagnoseDetail.diagnoseItemId,
                                              categoryDetails.data.classificationInsertId]);
          if (categoryDetails.categorieschildren !== undefined) {

            var categorizationInfoArray = categorizationMap[categoryDetails.data.name];
            var diagnoseItemId = diagnoseItemDetails.diagnoseDetail.diagnoseItemId;

            FunctionalityModule
              .getClassificationUtilitiesService()
              .constructDiagnoseClassificationParametersArray(diagnoseItemId,
                                     categoryDetails.categorieschildren,
                                     diagnoseClassificationQueryParams,
                                     categorizationInfoArray);
          }
        }
      });
      diagnoseItemDetails.categorizationMap = categorizationMap;
    });

    FunctionalityModule
      .getClassificationUtilitiesService()
      .insertCategorizationInfoInDB(diagnoseClassificationQueryParams)
      .then(function (resultClassificationIdArray) {
        _putDiagnoseDetailsForClient(clientId, diagnoseId, diagnoseName, allDiagnoseDetails,
                                                  _newDiagnose, sharedClassificationData);
      });
  }

  function _putDiagnoseDetailsForClient(clientId, diagnoseId, diagnoseName,
                                         diagnoseItems, newDiagnose, sharedClassificationData) {

    var $diagnoseDetailsCollapsibleSet = $('.js-diagnose-details', $('.js-client-details[data-client-id="' + clientId + '"]'));
    if (newDiagnose == true) {

      var panelHtml = _getDiagnosePanelHtml(diagnoseId, diagnoseName, clientId)

      $diagnoseDetailsCollapsibleSet.append(panelHtml).collapsibleset().collapsibleset( "refresh" );
    }

    $("#" + "diagnoseList" + clientId + diagnoseId)
        .data('diagnose-info', diagnoseItems).data('client-id', clientId)
        .html('').append(_getHtmlFromDiagnoseList(diagnoseItems))
        .listview().listview("refresh").trigger("updatelayout");

    _categorizeDiagnoseItems(clientId, diagnoseId, diagnoseItems,
                               sharedClassificationData);

    FunctionalityModule.enhancePage();
  }

  function _categorizeDiagnoseItems(clientId, diagnoseId, diagnoseItems,
                                     classificationData) {

    var  allDiagnoseItems = {};

    $.each(diagnoseItems, function (i, item) {

      var diagnoseItemId = item.id || item.diagnoseItemId;

      allDiagnoseItems[diagnoseItemId] = {
        name: item.controlLabel  + ' : ' + item.controlValueLabel,
        categorised: false
      }

      var categorizationMap = {};
      var classificationDataCopy = angular.copy(classificationData);

      DataModule.execute("diagnoseClassification", "selectDataWhere", [diagnoseItemId], function (results) {

        var rows = results.rows;

        if (rows !== undefined) {

          $.each(rows, function (i, diagnoseClassificationRow) {

            var found = false;
            $.each(classificationData, function (i, classData) {
              if (classData.data.classificationInsertId === diagnoseClassificationRow.classificationId) {
                classificationDataCopy[i].data.value = true;
                found = true;
              }
            });

            if (found === false) {
              $.each(classificationData, function (i, classData) {
                FunctionalityModule
                  .getClassificationUtilitiesService()
                  .updateCategoryInfoCopyWithValues(diagnoseClassificationRow.classificationId,
                                         classData.categorieschildren,
                                         classificationDataCopy[i].categorieschildren);
              });
            }
          });

          for (classificationItem of classificationDataCopy) {

            if (classificationItem.data.value) {
              categorizationMap[classificationItem.data.name] = [];
              categorizationMap[classificationItem.data.name].push(classificationItem.data.name);

              FunctionalityModule
                  .getClassificationUtilitiesService()
                  .constructCategorizationTree(categorizationMap[classificationItem.data.name],
                                                classificationItem.categorieschildren);

            }
          }
          allDiagnoseItems[diagnoseItemId].categorised = true;
          allDiagnoseItems[diagnoseItemId].categorizationMap = categorizationMap;
        }

        if (i === diagnoseItems.length - 1) {
          _updateDiagnoseListOnUI(clientId, diagnoseId, allDiagnoseItems)
        }
      });
    });
  }


  function _updateDiagnoseListOnUI(clientId, diagnoseId, allDiagnoseItems) {
    var classifiedLists = {};
    var classifiedListsHeader = {};

    for (itemKey in allDiagnoseItems) {

      var item = allDiagnoseItems[itemKey];

      for (category in item.categorizationMap) {
        var categorizationMapItem = allDiagnoseItems[itemKey].categorizationMap[category];

        var categorizationStr = categorizationMapItem.join(' : ');
        var listItemHtml = '<li  data-role="list-divider" style="font-weight:bold">'
                    + categorizationStr + '</li>';

        if (classifiedListsHeader[categorizationStr] === undefined) {
          classifiedListsHeader[categorizationStr] = listItemHtml;
        }

        if (classifiedLists[categorizationStr] === undefined) {
          classifiedLists[categorizationStr] = [];
        }
        classifiedLists[categorizationStr].push('<li>' + item.name + '</li>');
        item.categorized = true;
      }
    }

    var allHtml = "";
    for (classifiedItem in classifiedListsHeader) {
      allHtml += classifiedListsHeader[classifiedItem];
      allHtml += classifiedLists[classifiedItem].join('');
    }

    var $diagnoseList = $('#diagnoseList' + clientId + diagnoseId);

    $diagnoseList.html(allHtml);

    var unclassifiedHeaderAdded = false;
    $.each(allDiagnoseItems, function (key, item) {
      if (item.categorized === true) return;

      if (!unclassifiedHeaderAdded) {
        $diagnoseList.append('<li data-role="list-divider" style="font-weight: bold">Unclassified</li>');
        unclassifiedHeaderAdded = true;
      }
      $diagnoseList.append('<li>' + item.name + '</li>');
    });

    $diagnoseList.listview().listview("refresh").trigger("updatelayout");

    FunctionalityModule.enhancePage();
  }

  function _getDiagnosePanelHtml(diagnoseId, diagnoseName, clientId) {
    var panelHtml = getHtmlFromTemplate('#collapsiblePanelForClientDiagnoseTemplate',
                                        {   "properties": {
                                              "heading": diagnoseName,
                                              "clientId": clientId,
                                              "id": diagnoseId,
                                              "uniqueDiagnoseListId": "diagnoseList" + clientId + diagnoseId,
                                              "classes": FunctionalityModule.getClassificationCount() > 0 ?
                                                        "js-classify-diagnose-button":"js-classify-diagnose-button ui-disabled"
                                            }
                                          });
    return panelHtml;
  }

  function _getHtmlFromDiagnoseList(diagnoseItems) {

    return $.map(diagnoseItems, function (item, i) {
      var itemHtml = '<li data-diagnose-item-id="' + item.diagnoseItemId
                          + '" data-diagnose-id="' + item.diagnoseId + '">' + item.controlLabel + ' : '
                          + item.controlValueLabel + '</li>';
      return itemHtml;
    }).join("");
  }

  return self;
